import React from 'react';

function Img(props) {

    return <div className="">
                <img

                    src="../../image/SfMCWNmA8mY.jpg"
                    alt={props.alt}
                    tabIndex={props.tabindex}
                    contextMenu={props.contextmenu}
                />
            </div>
 
}

export default Img
